import classes from "../News/NewsItem.module.css";
import AboutUsFeed from "./AboutUsFeed";
import PlayersFeed from "../Players/PlayersFeed";
import ReactDOM from "react-dom/client";

const AboutUs = ({ aboutUs }) => {
    return (
        <div className={classes.post_container}>
            <div className={classes.date}>{aboutUs.date}</div>
            <h2 className={classes.title}>{aboutUs.title}</h2>
            <p className={classes.desc}>
                <div countryCode="US"
                     svg
                     style={{
                         width: '2em',
                         height: '2em',
                     }}
                     title="US"></div>
                <div>{aboutUs.roster}</div>
            </p>
            <img className={classes.img} src={aboutUs.rosterImg}/>
        </div>
    );
};

export default AboutUs;
